import './styles/App.css';
import './styles/parallax.css';
import './styles/lens-flare.css';
import LensBlinkJSX from './components/lens-blink';

function App() {

	let origin = {
    left: 1,
    top: 1
  }

  const styles = {
    blink: {
      position: 'absolute',
      borderRadius: '50%',
      opacity: 0.5
    }
  }

  const Blink1 = LensBlinkJSX(
    <div className="lens-blink" style={styles.blink}></div>
  );

	return (
    <div className="main">
      <div className="parallax">
        <div className="parallax-group">

          <div className="parallax-layer parallax-layer--back">
            <img className="background" src="./media/background3.png"/>
          </div>


          <div id="lens-flare">
            <Blink1 />
          </div>


          <div className="parallax-layer parallax-layer--base">

          </div>

        </div>
      </div>
    </div>
	);
}

export default App;
